import PropTypes from 'prop-types'

function Button({text, def}) {
    if(!text){
        console.error("El texto es requerido")
    }

    return <button>
        {text}{def}
    </button>
}

Button.propTypes = {
    text: PropTypes.string.isRequired
}

Button.defaultProps = {
    def: "Default Text"
}

export default Button
